INSERT INTO `ec_reviews` VALUES (1,4,NULL,NULL,31,1,'This script is well coded and is super fast. The support is pretty quick. Very patient and helpful team. I strongly recommend it and they deserve more than 5 stars.','published','2025-01-21 09:39:33','2025-01-21 09:39:33','[\"products\\/product-14.jpg\",\"products\\/product-15.jpg\",\"products\\/product-38.jpg\",\"products\\/product-93.jpg\"]'),(2,6,NULL,NULL,41,1,'Best ecommerce CMS online store!','published','2025-01-21 09:39:33','2025-01-21 09:39:33','[\"products\\/product-59.jpg\"]'),(3,8,NULL,NULL,42,2,'Good app, good backup service and support. Good documentation.','published','2025-01-21 09:39:33','2025-01-21 09:39:33','[\"products\\/pla-product-03.jpg\"]'),(4,4,NULL,NULL,26,3,'Second or third time that I buy a Botble product, happy with the products and support. You guys do a good job :)','published','2025-01-21 09:39:33','2025-01-21 09:39:33','[\"products\\/product-22.jpg\",\"products\\/product-74.jpg\"]'),(5,7,NULL,NULL,10,3,'Clean & perfect source code','published','2025-01-21 09:39:33','2025-01-21 09:39:33','[\"products\\/product-19.jpg\",\"products\\/product-81.jpg\"]'),(6,1,NULL,NULL,45,4,'These guys are amazing! Responses immediately, amazing support and help... I immediately feel at ease after Purchasing..','published','2025-01-21 09:39:33','2025-01-21 09:39:33','[\"products\\/product-8.jpg\",\"products\\/product-44.jpg\",\"products\\/product-77.jpg\"]'),(7,1,NULL,NULL,34,1,'Those guys now what they are doing, the release such a good product that it\'s a pleasure to work with ! Even when I was stuck on the project, I created a ticket and the next day it was replied by the team. GOOD JOB guys. I love working with them :)','published','2025-01-21 09:39:33','2025-01-21 09:39:33','[\"products\\/product-81.jpg\"]'),(8,9,NULL,NULL,2,1,'For me the best eCommerce script on Envato at this moment: modern, clean code, a lot of great features. The customer support is great too: I always get an answer within ho